export interface User{
    avatarUrl: string;
    birthday: string;
    department: string;
    firstName: string;
    id: string;
    lastName: string;
    phone:string
    position: string;
    userTag: string;
}




export interface AllUsersAction{
    type: string;
    allUsers:User[]
}

export type AllUsersState = User[]|null;
